class CalculatorTests: XCTestCase {
    var sut: Calculator!

    override func setUp() {
        self.setUp()
        sut = Calculator()
    }

    override func tearDown() {
        sut = nil
        self.tearDown()
    }

    func testTwoPlusTwoEqualsFour() {
        let result = sut.enter(2).add(2)
        XCTAssertEqual(result, 4)
    }
}
```

